import {Card, Button} from "react-bootstrap";


export default function SongBox({song}){
    return (
        <>
            <Card style={{ width: '200px', height: '200px' }} className="d-flex btn-outline-danger align-content-sm-start" as={Button}>
                <Card.Body >
                    <Card.Title className="fs-2 text-start" >{song.title}</Card.Title>
                    <Card.Subtitle className="mb-2 font-weight-light">{song.artist_list.map(artist=>artist+"\n")}</Card.Subtitle>

                </Card.Body>
            </Card>
        </>
    )

}
